import React from 'react';
import { useNavigate } from 'react-router-dom';

const Logout = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Perform any necessary logout actions here, such as clearing local storage, sending a logout request to the server, etc.

    // Redirect to the login page or any other desired page
    navigate('/login');
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <button
        className="px-8 py-3 rounded-md bg-orange-500 text-white font-medium hover:bg-orange-600 focus:outline-none focus:shadow-outline"
        onClick={handleLogout}
      >
        LOG OUT
      </button>
    </div>
  );
};

export default Logout;
